T = int(input())
for test_case in range(1, T + 1):
    n = int(input())
    want = [int(i) for i in input().split()]
    cap = [int(i) for i in input().split()]
    want.sort()
    cap.sort()
    answer=0
    while want and cap:
        if len(want)>0 and len(cap)>0 and abs(want[-1]-cap[-1])>3:
            if want[-1]>cap[-1]:
                want.pop()
            elif want[-1]<cap[-1]:
                cap.pop()

        elif len(want)>0 and len(cap)>0 and abs(want[-1]-cap[-1])<=3:
            answer+=1
            cap.pop()
            want.pop()

    print("#%d %d" % (test_case, answer))

